    {
        static void minimumBribes(int[] q)
        {
            Stopwatch stopwatch = new Stopwatch();
            stopwatch.Start();

            int count = 0;

            int start = q.Min();

            bool isTooChoatic = false;

            long temp2 = 0;

            int minIndex = q.Length - 1;


            for (int i = 0; i < q.Length; i++)
            {

                if (i + start >= q[i])
                {
                    if (q[i] > q[minIndex] && i < minIndex)
                    {
                        count++;
                    }
                    else
                    {
                        int temp = 0;
                        for (int j = i + 1; j < q.Length; j++)
                        {

                            temp2++;
                            if (q[i] > q[j])
                            {
                                minIndex = j;
                                count++;
                                break;
                            }

                            if (q[j] - (j + start) == 0)
                            {
                                ++temp;
                                if (temp > 3)
                                    break;
                            }
                        }
                    }
                }
                else
                {
                    int temp = q[i] - (i + start);

                    if (temp <= 2)
                    {
                        count += temp;
                    }
                    else
                    {
                        isTooChoatic = true;
                        break;
                    }
                }
            }

            Console.WriteLine("Temp2 : " + temp2);

            if (isTooChoatic)
            {
                Console.WriteLine("Too chaotic");
            }
            else
            {
                Console.WriteLine(count);
            }

            TimeSpan ts = stopwatch.Elapsed;
            Console.WriteLine("Time taken : " + ts.Seconds);

        }

        static int MaxiumCount(int value, int[] array)
        {

            int count = 0;

            for (int i = array.Length - 1; i >= 0; i--)
            {
                if (value < array[i])
                {
                    count++;
                }
            }

            return count;
        }

